column2:
Why is this cutting and (and) and this union (or)
One and the other, saying, out of everything, leave what he and he are, and not leave it and that too
One or the other, saying out of everything you leave what he or she or both or both, and not leave one of the two
A & B: {x: x in A and x in B}
not {x: x in A or x in B}
A | B: {x: x in A or x in B}
not: {x: x in A and not in B} or {x: x in B and not in A} but not both

A | B ~ = A + B
A & B ~ = A * B
